import Nav from "./Navigation/Nav";
import LifeBox from "./Life/LifeBox";
import ManaBox from "./Mana/ManaBox";
import { usePlayerMenu } from "../Bottom/Players/PlayerMenuContext";

const Top = ({ togglePlayerMenu }) => {
  return (
    <section className="h-50 bg-white d-flex flex-column">
      <Nav togglePlayerMenu={togglePlayerMenu} />
      <LifeBox />
      <ManaBox />
    </section>
  );
};

export default Top;
